        'legal.policy.terms.links.title': 'LINKS TO OTHER WEBSITES',
        'legal.policy.terms.links.desc': 'Nic Juice To Japan (NJ2JP) makes no representation whatsoever regarding the content of any other web sites which you may access from this site. When you access a non-Nic Juice To Japan (NJ2JP) web site, please understand that it is independent from Nic Juice To Japan (NJ2JP) and that Nic Juice To Japan (NJ2JP) has no control over the content on that web site. A link to a non-Nic Juice To Japan (NJ2JP) web site does not mean that Nic Juice To Japan (NJ2JP) endorses or accepts any responsibility for the content or use of such web site.',
        'legal.policy.terms.submissions.title': 'SUBMISSIONS',
        'legal.policy.terms.submissions.desc': 'Should any viewer of a document on this web site respond to Nic Juice To Japan (NJ2JP) with information including feedback data, such as questions, comments, suggestions, or the like regarding the site, or the content of any item, such information shall be deemed to be non-confidential and Nic Juice To Japan (NJ2JP) shall have no obligation of any kind with respect to such information. In addition, Nic Juice To Japan (NJ2JP) shall be free to reproduce, use, disclose, display, exhibit, transmit, perform, create derivative works, and distribute the information to others without limitation, and to authorize others to do the same. Further, Nic Juice To Japan (NJ2JP) shall be free to use any ideas, concepts, know-how or techniques contained in such information for any purpose whatsoever, including, but not limited to, developing, manufacturing and marketing products and other items incorporating such information. This paragraph is not intended to apply to any personal information about you (such as name, mailing address and e-mail address), the use of which will be governed by Nic Juice To Japan (NJ2JP)‚Äôs Privacy Statement. In consideration of Nic Juice To Japan (NJ2JP)‚Äôs continuing efforts to enhance and improve these products and to respond to feedback from users, you agree to transfer such ideas, concepts, know-how and techniques to Nic Juice To Japan (NJ2JP) without any compensation. You agree to execute any and all documents that Nic Juice To Japan (NJ2JP) may reasonably request in connection with confirming Nic Juice To Japan (NJ2JP)‚Äôs ownership of and unlimited right to use such ideas, concepts, know-how and techniques. You are solely responsible for the content of any comments you make. You agree that no comments submitted by you to this web site will: (i) violate any right of any third party, including copyright, trademark, privacy or other personal or proprietary rights; (ii) be or contain libelous or otherwise unlawful, abusive, or obscene material or constitute the misappropriation of the trade secrets of any third party; and (iii) disparage the products or services of any third party. You agree not to submit any personal information (other than your email address or username) through email sent to other users or messages posted on this site by you.',
        'legal.policy.terms.termination.title': 'TERMINATION',
        'legal.policy.terms.termination.desc': 'This Agreement is effective unless and until terminated by either you or Nic Juice To Japan (NJ2JP). You may terminate this Agreement at any time by no longer using this web site, provided that all prior uses of this web site shall be governed by this Agreement. Nic Juice To Japan (NJ2JP) may terminate this Agreement at any time and without notice, and accordingly deny you access to this web site, in Nic Juice To Japan (NJ2JP)\'s sole discretion for any reason, including your failure to comply with any term or provision of this Agreement. Upon any termination of this Agreement by either you or Nic Juice To Japan (NJ2JP), you must promptly destroy all materials downloaded or otherwise obtained from this web site, as well as all copies of such materials, whether made under the terms of this Agreement or otherwise.',
